import React, { useState, useEffect, useCallback} from 'react';
import styled from 'styled-components';
import Header from '../components/Header';
import Sidebar from '../components/Sidebar';
import PostCard from '../components/PostCard';
import { useParams } from 'react-router-dom';
const PageLayout = styled.div`
  display: flex;
  min-height: 100vh;
`;

const MainContent = styled.main`
  flex-grow: 1;
  padding: 20px;
  background-color: #f5f5f5;
`;

const PostGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 20px;
`;

const Country = styled.div`
    color: #333;
    margin: 0;
    font-size: 24px;
    font-weight: bold;
`

const FilterButtons = styled.div`
margin-bottom: 20px;
`;

const FilterButton = styled.button`
margin-right: 10px;
padding: 5px 10px;
background-color: ${props => props.active ? '#FFD43B' : '#f8f9fa'};
color: ${props => props.active ? 'white' : 'black'};
border: 1px solid #FFD43B;
border-radius: 5px;
cursor: pointer;

&:hover {
  background-color: #FFD43B;
  color: white;
}
`;

const CommunityPage = () => {
    const [posts, setPosts] = useState([]);
    const [sortBy, setSortBy] = useState('likes');
    const { country } = useParams(); // URL에서 국가 정보를 가져옵니다

    const countryInfo = {
      canada: { korName: '캐나다', flag: '🇨🇦' },
      australia: { korName: '호주', flag: '🇦🇺' },
      newzealand: { korName: '뉴질랜드', flag: '🇳🇿' },
      england: { korName: '영국', flag: '🇬🇧' },
      netherlands: { korName: '네덜란드', flag: '🇳🇱' },
      germany: { korName: '독일', flag: '🇩🇪' }
    };

    const fetchPosts = useCallback(() => {
      // 여기서 DB나 API로부터 데이터를 가져옵니다.
      const fetchedPosts = [
        {
          id: 1,
          title: "캐나다 밴쿠버 여행 후기",
          likes: 42,
          author: "여행자123",
          date: "2023-07-15",
          preview: "밴쿠버의 아름다운 자연과 도시 풍경을 소개합니다.",
          country: "canada"
        },
        {
          id: 2,
          title: "호주 시드니 오페라 하우스 탐방",
          likes: 38,
          author: "문화탐험가",
          date: "2023-07-20",
          preview: "시드니의 상징, 오페라 하우스를 둘러봤습니다.",
          country: "australia"
        },
        {
            id: 3,
            title: "뉴질랜드 로드트립 추천 코스",
            likes: 55,
            author: "자연사랑",
            date: "2023-08-05",
            preview: "뉴질랜드의 아름다운 자연을 만끽할 수 있는 로드트립 코스를 소개합니다.",
            country: "newzealand"
          },
          {
            id: 4,
            title: "영국 런던 박물관 투어",
            likes: 30,
            author: "역사광",
            date: "2023-08-10",
            preview: "대영박물관부터 내셔널 갤러리까지, 런던의 주요 박물관을 둘러봤습니다.",
            country: "england"
          },
          {
            id: 5,
            title: "네덜란드 암스테르담 운하 크루즈",
            likes: 47,
            author: "유럽여행러",
            date: "2023-08-15",
            preview: "암스테르담의 아름다운 운하를 따라 도시의 매력을 느껴보세요.",
            country: "netherlands"
          },
          {
            id: 6,
            title: "독일 옥토버페스트 체험기",
            likes: 60,
            author: "축제마니아",
            date: "2023-09-20",
            preview: "뮌헨에서 열리는 세계 최대의 맥주 축제, 옥토버페스트를 즐겼습니다.",
            country: "germany"
          }
      ];
      return fetchedPosts.filter(post => post.country === country);
    }, [country]);

    useEffect(() => {
      const fetchedPosts = fetchPosts();
      setPosts(fetchedPosts);
    }, [fetchPosts]);

    const sortPosts = useCallback((postsToSort) => {
      return [...postsToSort].sort((a, b) => {
        if (sortBy === 'likes') {
          return b.likes - a.likes;
        } else {
          return new Date(b.date) - new Date(a.date);
        }
      });
    }, [sortBy]);

    useEffect(() => {
      setPosts(prevPosts => sortPosts(prevPosts));
    }, [sortBy, sortPosts]);

    const handleSortChange = (newSortBy) => {
      setSortBy(newSortBy);
    };

    return (
      <>
        <Header />
        <PageLayout>
          <Sidebar />
          <MainContent>
            <Country>{countryInfo[country]?.flag} {countryInfo[country]?.korName} 커뮤니티</Country>
            <FilterButtons>
              <FilterButton 
                onClick={() => handleSortChange('likes')}
                active={sortBy === 'likes'}
              >
                좋아요 순
              </FilterButton>
              <FilterButton 
                onClick={() => handleSortChange('date')}
                active={sortBy === 'date'}
              >
                최신순
              </FilterButton>
            </FilterButtons>
            <PostGrid>
              {posts.map(post => (
                <PostCard 
                  key={post.id}
                  title={post.title}
                  likes={post.likes}
                  author={post.author}
                  date={post.date}
                  preview={post.preview}
                />
              ))}
            </PostGrid>
          </MainContent>
        </PageLayout>
      </>
    );
  }

  export default CommunityPage;
